	(1, 'synapsesociety', '*120C453F80180BE1215C1AC1211FAFDBE6979660');
INSERT INTO `DiseaseInfo` (`Idx`, `DiseaseTitle`, `DiseaseContents`, `MedicalSubject1`, `MedicalSubject2`, `MedicalSubject3`) VALUES
	(1, 'Chứng ngứa', 'cảm giác khó chịu muốn gãi hoặc chà xát.</br> Phát sinh bởi tác động đa dạng của bên ngoài.</br> Do ngứa mà gãi nhiều lên da, sẽ phát sinh hiện tượng da sẽ dày lên giống như da thuộc.</br> Đặc biệt, lỗ mũi, hậu môn, vùng háng là những vùng rất nhạy cảm, dễ bị ngứa.</br> Chứng ngứa thường đi chung với bệnh da liễu nhưng cũng có trường hợp liên quan đến bệnh toàn thân, bệnh tâm thần nên ta cần tìm r', 'khoa da liễu', '', 'trạm xá'),
	(2, 'Viêm kết mạc', 'Vì kết mạc của mắt để lộ ra ngoài nên các vi sinh vật đa dạng dễ dàng xâm nhập vào, có thể phát sinh chứng viêm do các chất như bụi, phấn hoa, dược phẩm, mỹ phẩm v.</br>v.</br>Chứng viêm kết mạc là trạng thái kết mạc bị tác động bởi phấn hoa và vi sinh vật như vi khuẩn, vi nấm v.</br>v gây ra chứng viêm.</br>', 'khoa mắt', '', 'trạm xá'),
	(3, 'Bệnh ho', 'Có nhiều nguyên nhân gây ho từ cảm cúm đến ung thu phổi, thật đa dạng, nguyên nhân gây ho cũng có thể chỉ do duy nhất một chứng bệnh nào đó nhưng cũng có trường hợp do nhiều nguyên nhân tổng hợp như trường hợp do bị hen suyễn và bị viêm mũi hoặc bị hen suyễn và chứng trào ngược dạ dày thực quản.</br>', 'nội khoa', 'khoa nhi đồng', 'trạm xá'),
	(4, 'Gãy xương', 'là chứng xương bị gãy.</br>Gãy xương được phân làm 2 loại: 1 là gãy xương hở, xương bị lồi ra ngoài da, 2 là gãy nhiều mảnh, xương bị gãy nát vụn.</br>Xương sau khi bị gãy cũng có thể tự chữa trị bằng cơ cấu xương nhưng để được điều trị cho lành lại, phần xương bị gãy đó phải được giữ cố định và cung cấp máu huyết đầy đủ kèm theo những tác động thích hợp mới được.</br>', 'khoa chỉnh hình', 'đông y', 'trạm xá'),
	(5, 'Mụn lẹo mắt', 'ở mí mắt có nhiều cơ quan phụ thuộc da và bài tiết nước mắt và mồ hôi.</br>Chứng mụn lẹo mắt là chứng viêm bởi tuyến bài tiết này.</br>', 'khoa mắt', '', 'trạm xá'),
	(6, 'Vô kinh', 'là chứng không có kinh nguyệt.</br> Thường thì vô kinh là nói đến trường hợp phụ nữ từng có kinh đột nhiên chu kỳ bị dài ra gấp 3 lần so với trước đó hoặc không có kinh từ 6 tháng trở lên.</br> Do chu kỳ kinh nguyệt bị ảnh hưởng nhiều từ môi trường bên ngoài nên 1 tháng không có kinh cũng không sao nhưng nếu không có kinh trong một thời gian dài, có khả năng do sức khỏe có vấn đề, cần phải chữa tr', 'khoa phụ sản', '', 'trạm xá'),
	(7, 'Đau bụng', 'xuất hiện đa dạng từ trường hợp bị chứng đau bụng cấp tính có thể ảnh hưởng đến tính mạng trong thời gian ngắn đến trường hợp bị mãn tính do rối loạn chức năng.</br>Đau bụng chủ yếu phát sinh từ cơ quan tiêu hóa ở vùng bụng nhưng thỉnh thoảng cũng phát sinh do tim, phổi, thận, tử cung, buồng trứng v.</br>v.</br>.</br> Trường hợp bị đau thường xuyên ở bụng, cần phải đi bệnh viện khám.</br>', 'nội khoa', '', 'trạm xá'),
	(8, 'Triệu chứng lạ liên quan đến việc đi tiểu', 'chứng lạ khi tiểu là nói chung hết các triệu chứng lạ phát sinh khi đi tiểu, xuất hiện khi chức năng dự trữ nước tiểu hoặc chức năng tiểu có triệu chứng lạ, có khả năng là do bàng quang, đường tiết niệu, thận v.</br>v có vấn đề, cần chẩn đoán và chữa trị của bác sĩ.</br>', 'khoa tiết niệu', '', 'trạm xá'),
	(9, 'Răng khôn', 'là răng mọc cuối cùng ở trong xương hàm, nếu khoảng trống trong xương hàm không đủ, răng khôn sẽ mọc và bị dị dạng, từ đó gây ra các biến chứng đa dạng nên việc nhổ răng khôn rất quan trọng, công tác xử lý ngoại khoa này thường thấy trong lĩnh vực nha khoa.</br>', 'nha khoa', '', 'trạm xá'),
	(10, 'Chàm', 'là chứng bệnh da liễu, gây ra ban đỏ, mủ trên da, càng mãn tính da càng dày, thường kèm theo chứng ngứa ngáy dữ dội, nếu chữa trị trễ, sẽ lan rộng ra và phát triển thành mãn tính, ác tính, do vậy cần chữa trị nhanh.</br>', 'khoa da liễu', '', 'trạm xá'),
	(11, 'Tiêu chảy', 'tiêu chảy có khả năng là do bị viêm cấp tính bởi vi khuẩn hay bacteria nhưng cũng phát sinh do chứng viêm mãn tính như viêm đường ruột v.</br>v.</br> cũng có thể do ăn uống mà phát sinh.</br> Thêm nữa, không có lý do gì đặc biệt mà bị tiêu chảy liên tục trong vòng 3 tháng, trường hợp này gọi là tiêu chảy tính năng, tiêu biểu nhất là chứng tiêu chảy do hội chứng ruột kích thích gây ra.</br>Đa số ti', 'nội khoa', '', 'trạm xá'),
	(12, 'Khó tiêu hóa', 'thông thường, nói đến chứng khó tiêu là nói đến chứng bị khó tiêu mà có khám cũng không phát hiện gì lạ, là nói đến cảm giác no bụng sau khi ăn, căng bụng trên, cảm giác mau no, buồn nôn, ợ hơi, bụng trên bị đau sau khi ăn hoặc thấy khó chịu.</br>', 'nội khoa', '', 'trạm xá'),
	(13, 'Bong gân', 'là chứng gân cố định xương bị thương, bao gồm trường hợp nhẹ như cổ chân bị trật khớp hay do bắt bóng, đưa ngón tay ra phía sau nên bị thương, đến trường hợp nặng như bị đứt gân, các trường hợp bị thương gân thật đa dạng.</br>', 'ngoại khoa', 'đông y', 'trạm xá'),
	(14, 'Vết thương hở, chảy máu', 'da trên người chúng ta là cơ quan chiếm diện tích rộng nhất và phơi bày nhiều nhất, bao gồm cả móng tay, móng chân, tóc.</br> Da được hình thành từ 2 lớp là lớp biểu bì và lớp bì, vết thương hở là vết thương do da bị rách mà thành.</br>', 'ngoại khoa', '', 'trạm xá'),
	(15, 'Buồn nôn và ối mửa', 'là cảm giác chủ quan, cảm thấy khó chịu muốn nôn mửa.</br>Chứng buồn nôn đôi khi cũng đi kèm với triệu chứng ối mửa, khó tiêu hóa, chỉ buồn nôn thôi cũng có.</br> Ối mửa là chứng các thứ có trong thực quản, dạ dày, tá tràng đi ra ngoài thông qua miệng.</br>Nếu bệnh nhân đến bệnh viện do chứng buồn nôn và ối mửa, khám xem có mắc bệnh gì nghiêm trọng không, chữa trị giảm triệu chứng, vô nước biển để', 'nội khoa', '', 'trạm xá'),
	(16, 'Đau lưng', 'là căn bệnh rất phổ biến, xếp thứ năm trong các triệu chứng có nguyên nhân chủ yếu làm bệnh nhân tìm đến bệnh viện.</br>Thông thường, chứng đau lưng không gây biến chứng hay tạo ra vấn đề gì lớn nhưng ở 1 ít trường hợp, nó cũng gây nên biến chứng hay phát sinh bệnh nguy hiểm.</br>Chứng đau lưng là chứng đau như muốn rớt lưng ra ngoài hoặc gãy ra, có thể xuất hiện nhiều hình thái đa dạng như cơn đa', 'ngoại khoa', '', 'trạm xá'),
	(17, 'Sâu răng', 'sâu răng là căn bệnh mãn tính phổ biến nhất trên thế giới được phát hiện từ thời tiền sử.</br>Sâu răng là bệnh mãn tính thường thấy nhất, nếu bỏ mặc thì kết cuộc ta sẽ bị mất răng đi, nếu răng bị mất, sức nhai bị yếu, gặp vấn đề trong việc nhai thức ăn nên không thể không xem đó là vấn đề nghiêm trọng.</br> Thêm nữa là sâu răng sẽ gây ra những cơn đau nhức dữ dội.</br>', 'nha khoa', '', 'trạm xá'),
	(18, 'Nôn ra máu', 'chứng nôn ra máu là chứng xuất huyết phát sinh bởi các nguyên nhân đa dạng từ thực quản, dạ dày, tá trạng v.</br>v, máu đó tụ lại, khi nôn mửa sẽ mửa ra máu.</br>Thường hay phân biệt giữa nôn ra máu và ho ra máu, ho ra máu là chứng xuất huyết của phổi, cuốn phổi, khi ho ra máu thông qua đường miệng.</br>Nếu nôn ngay sau khi xuất huyết, sẽ có màu đỏ tươi nhưng nếu qua 1 thời gian mới nôn, vài trườn', 'nội khoa', '', 'trạm xá'),
	(19, 'Đau ngực', 'chứng đau ngực là chứng đau hoặc khó chịu ở vùng ngực, có nhiều nguyên nhân gây ra triệu chứng đau ngực, từ cơn đau nhẹ, nhất thời đến bệnh nghiêm trọng như chứng nhồi máu cơ tim, phình mạch tách v.</br>v.</br> nếu không nhanh chóng chữa trị sẽ gây ra tử vong.</br> Thông thường, nguyên nhân gây ra chứng đau ngực cho người lớn thường thấy nhất là do cơ hay dây chằng vùng ngực bị giãn ra, đa số là n', 'nội khoa', 'ngoại khoa', 'trạm xá'),
	(20, 'Đau bụng kinh', 'là triệu chứng thường thấy chiếm đến 50% trong số phụ nữ có kinh nguyệt.</br>Đau bụng kinh có sự khác nhau theo mức độ hình thái của triệu chứng, vì là triệu chứng thường gặp nên nhiều chị em phụ nữ hay xem nhẹ nó.</br>Tuy nhiên, quan trọng là phân biệt xem khung xương chậu hay vùng nội tạng khác có vấn đề gì hay không nên nếu bị đau bụng kinh, nhất định phải đến bệnh viện khám.</br>', 'khoa phụ sản', '', 'trạm xá'),
	(21, 'Chứng nổi ban ở trẻ em', 'là chứng mọc những mụt nhỏ lan tràn trên da, cần nhanh chóng trị liệu, nguyên nhân là do vi khuẩn, vi nấm, dược phẩm v.</br>vMỗi chứng bệnh gây nổi ban đều có mức độ nghiêm trọng khác nhau nên cần phải chẩn đoán chính xác và chữa trị kịp thời của bác sĩ.</br>', 'khoa nhi đồng', '', 'trạm xá'),
	(22, 'Ngộ độc thức ăn', 'là chứng sau khi ăn bị nhiểm độc sinh ra các triệu chứng tiêu chảy, đau bụng.</br>Đa phần ngộ độc thức ăn là do vi khuẩn hay độc tố của vi khuẩn gây ra.</br> Trường hợp viêm ruột đa số có liên quan đến việc hấp thụ thức ăn, có triệu chứng giông giống với ngộ độc thức ăn, có triệu chứng như mẩn ngứa, nhất định phải đến bệnh viện trị liệu.</br>', 'nội khoa', 'khoa y học gia đình', 'trạm xá'),
	(23, 'Viêm khớp', 'là chứng bệnh phần sụn bị mòn theo thời gian và kèm theo triệu chứng và biến đổi phát sinh khác có liên quan.</br>Do Sụn bị tổn thương hay biến đổi theo thời gian mà phát sinh tổn thương cho xương và dây chằng xung quanh, tạo ra cơn đau, biến hình, rối loạn chức năng, là căn bệnh tiêu biểu nhất trong căn bệnh viêm khớp.</br>', 'khoa chỉnh hình', 'đông y', 'trạm xá'),
	(24, 'Ho ra máu', 'là chứng ho có máu hoặc đờm trộn lẫn máu thải ra ngoài.</br>Nếu kèm theo ho hoặc máu có màu đỏ tươi thì khả năng là chứng ho ra máu cao, nếu nôn mửa hay máu có màu đỏ đậm đen thì không phải nhưng không chính xác, có thể là do nội tạng trọng yếu như phổi v.</br>v có vấn đề nên cần đến bệnh viện khám.</br>', 'nội khoa', 'ngoại khoa', 'trạm xá'),
	(25, 'Xung huyết mắt', 'là chứng mắt bị đỏ do mạch máu ở tròng trắng mắt bị chảy máu.</br>Có nhiều nguyên nhân dẫn đến xung huyết nhưng thường thấy nhất là do viêm kết mạc.</br>Để chẩn đoán xung huyết mắt dùng các thông tin của bệnh nhân cung cấp để chẩn đoán là hữu dụng nhất, khi nào bị và kéo dài trong bao lâu, 1 bên mắt bị thôi hay 2 bên đều bị, có tác động gì bên ngoài làm xung huyết hay không v.</br>v tất cả các thô', 'khoa mắt', '', 'trạm xá'),
	(26, 'Bệnh chốc lở', 'là chứng viêm nhiễm da rất dễ lây lan thường gặp ở trẻ em, phát sinh trong môi trường thời tiết mùa hè nóng, ẩm, mất vệ sinh.</br>Đặc điểm của bệnh này là có mụn nước, cương mủ, đóng vảy nhìn bẩn, bệnh chốc lở lây lan qua tiếp xúc chiếm 70%.</br> Do bệnh chốc lở có tính truyền nhiễm nên quan trọng là phải rửa tay sạch sẽ, giặt rửa và tẩy trùng quần áo, khăn, ly, chăn của trẻ bị nhiễm bệnh.</br>', 'khoa da liễu', 'khoa nhi đồng', 'trạm xá'),
	(27, 'Chứng dị ứng mẩn ngứa', 'là chứng bệnh da phổ biến nhất, do nhiều nguyên nhân khác nhau, da bị sưng và biến thành màu đỏ hay màu trắng.</br>Thường thấy có dấu hiệu ngứa, đỏ da nhưng trong trường hợp phát bệnh từ lớp bì dưới da mà ra thì có triệu chứng sưng tấy và cảm thấy đau hơn là ngứa.</br>Mẩn ngứa có một loại là mãn tính có triệu chứng kéo dài trong 6 tuần và một loại là cấp tính chỉ qua 1 tuần là khỏi.</br> Cấp tính', 'khoa da liễu', 'nội khoa', 'trạm xá'),
	(28, 'Chứng phù thũng', 'là triệu chứng cơ thể bị sưng phù mà ai cũng ít nhiều 1 lần trãi qua.</br>Là trạng thái dự trữ nước bất bình thường giữa tế bào và tế bào trong cơ thể.</br> Trường hợp toàn bộ cơ thể bị sưng phù, ta gọi là phù thũng toàn thân, nếu chỉ bị sưng 1 bộ phận cơ thể nào đó, ta gọi là phù thũng cục bộ.</br> Thông thường, phù thũng toàn thân là do bệnh suy tim, sơ gan, suy thận, ngược lại phù thũng cục bộ', 'nội khoa', 'ngoại khoa', 'trạm xá'),
	(29, 'Chướng bụng', 'là cảm giác bụng bị cương lên như có bong bóng nằm trong bụng vậy.</br>Không những bụng cảm thấy khó chịu mà kèm theo chứng đau bụng, táo bón làm cho chất lượng cuộc sống bị kém đi.</br>Có nhiều nguyên nhân gây ra chứng chướng bụng nhưng nếu đột ngột bụng cương lên, được xem là do máu tụ lại ở bụng bởi chấn thương bên ngoài, phải suy xét đến việc cấp cứu.</br>', 'nội khoa', 'ngoại khoa', 'trạm xá'),
	(30, 'Ngất xỉu', 'là triệu chứng bất ngờ mất ý thức và ngã xuống nhưng tỉnh lại sau 1 thời gian ngắn mà không cần có động tác gì đặc biệt.</br>Nguyên nhân ngất xỉu thật đa dạng, đa số các trường hợp không có lý do gì đặc biệt cả nhưng đôi khi cũng có trường hợp do 1 nguyên nhân nghiêm trọng mới dẫn đến ngất xỉu nên cần đến bác sĩ khám.</br>', 'nội khoa', 'ngoại khoa', 'trạm xá'),
	(31, 'Viêm da cơ địa', 'là bệnh da mãn tính kéo dài, thường gặp ở trẻ sau sinh 2~3 tháng tuổi.</br>Triệu chứng của viêm da cơ địa là nổi chàm rất ngứa trên da, thường thấy ở những người có quá khứ từng bị bệnh viêm da cơ địa hay người có người thân trong gia đình bị bệnh này.</br>Thông thường khi triệu chứng xuất hiện, bệnh nhân sẽ gãi hay chà xát lên vùng da đó, kết quả làm triệu chứng trầm trọng thêm, đó là điểm đặc tr', 'khoa da liễu', '', 'trạm xá'),
	(32, 'Sốt', 'là chứng bệnh nhiều người mắc phải, nhiệt độ cơ thể cao hơn bình thường, không phải theo chủ quan, nhận biết được cơ thể bị sốt mà là trực tiếp đo độ bằng nhiệt kế mới chẩn đoán được.</br>Sốt là dấu hiệu quan trọng báo cho ta biết được cơ thể chúng ta phát sinh vấn đề gì.</br> Nếu làm giảm sốt, ta có thể làm giảm đau cơ, đau đầu, cảm lạnh, phòng ngừa chứng co giật.</br>Triệu chứng của bệnh nhân bị', 'nội khoa', 'khoa nhi đồng', 'trạm xá'),
	(33, 'Viêm dạ dày', 'là tình trạng dạ dày bị viêm, phát sinh do nhiều nguyên nhân như truyền nhiễm hay thuốc v.</br>v.</br> Tuy nhiên, thường không có triệu chứng gì đặc trưng nên đa số bệnh nhân bị bệnh mà không có biểu hiện gì.</br>Có loại viêm dạ dày cấp tính và viêm dạ dày mãn tính, triệu chứng của viêm dạ dày cấp tính là đau bất ngờ quanh vùng chấn thủy, buồn nôn, ối mửa v.</br>v.</br> Trong trường hợp như vậy, t', 'nội khoa', '', 'trạm xá'),
	(34, 'Đau thần kinh tọa', 'là chứng đau từ hông hay mông đến cẳng chân.</br>Thông thường đau thần kinh tọa chủ yếu đau từ mông hay mặt ngoài bắp đùi xuống mặt ngoài và mặt sau bắp chuối chân.</br>Thêm nữa, cơn đau chủ yếu nhói lên, tê hay như có làn điện chạy qua hay đau như dao cắt, có trường hợp đau liên tục, có trường hợp thỉnh thoảng mới đau.</br>.</br> Đau thần kinh tọa 90% trở lên thường thấy thần kinh ở chổ được xem', 'khoa chỉnh hình', '', 'trạm xá'),
	(35, 'Bỏng', 'là vết thương ở da gây ra chủ yếu bởi nhiệt, 90% các vết bỏng là do chất lỏng hay vật  nóng, lửa, ánh nắng gây ra.</br>Trường hợp bị bỏng do điện hay chất hóa học có thể để lại di chứng nghiêm trọng.</br>Dựa vào độ nóng và thời gian tiếp xúc cơ thể, bộ phận tiếp xúc sẽ quyết định độ sâu và mức độ của vết bỏng.</br>Mức độ bỏng nhẹ chỉ xuất hiện triệu chứng như vùng bỏng sưng hay rộp nước, đỏ lên nh', 'ngoại khoa', 'khoa y học gia đình', 'trạm xá'),
	(36, 'Phân có máu hoặc phân đen', 'là chứng chảy máu từ cơ quan tiêu hóa bài tiết qua đường hậu môn, phân có màu đỏ tươi hoặc màu nâu đỏ được gọi là phân đỏ, phân có màu đen, có vẻ bóng bẩy, có mùi hôi thúi được gọi là phân đen.</br>Cả hai đều có nguyên nhân là xuất huyết do loét cơ quan tiêu hóa.</br> Trường hợp nghiêm trọng có thể nghi ngờ đó là bệnh ung thư dạ dày, ung thư đại tràng v.</br>v.</br>', 'nội khoa', '', 'trạm xá'),
	(37, 'Viêm Amidan', 'chứng sốt cao, cảm lạnh, sau đó cổ sưng đau, khi nuốt thức ăn, cổ bị đau, đau đầu kèm theo nhức khớp.</br>', 'khoa chỉnh hình', 'khoa y học gia đình', 'trạm xá'),
	(38, 'Chứng mất nước', 'là những triệu chứng như trường hợp bị tiêu chảy và nôn mửa nhiều lần, bị chảy nhiều mồ hôi, trường hợp thiếu hấp thu thức ăn và nước, trường hợp quản lý không tốt bệnh nhân bị tiểu đường và thận, trường hợp mất nước kèm theo chóng mặt v.</br>v.</br>', 'nội khoa', 'khoa y học gia đình', 'trạm xá'),
	(39, 'Chảy máu mũi', 'là triệu chứng chảy máu ở mũi, là trường hợp niêm mạc ở mũi bị thương nên chảy máu mũi.</br> Thông thường lấy bông gòn nhét vào mũi sẽ tự nhiên hết chảy máu nhưng nếu thường hay bị chảy máu mũi, có thể nghi ngờ có khối u gần mũi nên nếu thường xuyên bị chảy máu mũi, cần đến bệnh viện khám.</br>', 'nội khoa', 'khoa y học gia đình', 'trạm xá'),
	(40, 'Bạch cầu thanh quản', 'là chứng tiếng ho giống tiếng chó sủa, giọng bị khàn tiếng, hít thở vào khó, là do nguyên nhân như viêm cuống phổi cấp tính, viêm thanh quản v.</br>v.</br>', 'khoa chỉnh hình', 'nội khoa', 'trạm xá'),
	(41, 'Gù cột sống', 'là trường hợp cột sống cong ra phía trước hoặc sau quá độ.</br> Do cột sống có vấn đề dẫn đến nhiều chứng bệnh khác nhau, cần trị liệu của bác sĩ.</br>', 'khoa chỉnh hình', 'khoa phục hồi chức năng', 'trạm xá'),
	(42, 'Giảm cân', 'Trường hợp giảm cân đột ngột bất thường, nếu bị sút cân nhiều, có thể nghi ngờ bị mắc phải những chứng bệnh nặng như bệnh tiểu đường, bệnh thận', 'nội khoa', 'khoa y học gia đình', 'trạm xá'),
	(43, 'Sars:', 'là hội chứng hô hấp cấp tính nặng, là bệnh mang tính dễ truyền nhiễm lây lan, có triệu chứng phát sốt 38 độ trở lên, kèm ho và khó thở.</br>', 'trạm xá', '', 'trạm xá'),
	(44, 'Liệt mặt', 'là hiện tượng bị liệt cơ mặt như nháy mắt, biểu lộ nét mặt v.</br>v.</br>', 'đông y', '', 'trạm xá'),
	(45, 'Viêm sụn vành tai', 'ngứa trong lỗ tai, có cảm giác đầy tai, nếu kéo vành tai sẽ cảm thấy đau hơn, có thể không nghe được, có trường hợp chảy mủ từ tai ra.</br>', 'khoa chỉnh hình', '', 'trạm xá'),
	(46, 'Ù tai', 'triệu chứng thỉnh thoảng hay liên tục nghe tiếng ồn trong lỗ tai.</br>', 'khoa chỉnh hình', '', 'trạm xá'),
	(47, 'Chứng chóng mặt', 'phân biệt theo nhiều nguyên nhân khác nhau nhưng chóng mặt do sỏi tai cần phải phẩu thuật, trong trạng thái nằm gác chân lên cao, mặc quần áo thoải mái mà vẫn liên tục bị chóng mặt thì cần đến bệnh viện khám.</br>', 'khoa chỉnh hình', 'khoa y học gia đình', 'trạm xá'),
	(48, 'Chứng khô mắt', 'là triệu chứng khô nhãn cầu do lão hóa hay nhiễm khuẩn.</br> Thường thấy các dấu hiệu như mắt đau nhói, cảm thấy như có vật lạ trong mắt, đau rát, tiết ra chất nhầy v.</br>v', 'khoa mắt', '', 'trạm xá'),
	(49, 'Viêm đường tiết niệu', 'khi tiểu, có các triệu chứng kèm theo như đau, cảm giác chưa tiểu hết, triệu chứng khó nhịn tiểu, chứng són tiểu v.</br>v.</br>', 'khoa tiết niệu', '', 'trạm xá'),
	(50, 'Rụng tóc', 'chứng viêm xâm nhập nang lông, vấn đề di truyền và tự miễn dịch là quan trọng nhất, ngoài ra nhân tố môi trường như căng thẳng thần kinh cũng là nguyên nhân gây ra, trường hợp do tự miễn dịch có 10% kèm theo bệnh tật tự miễn dịch khác như bệnh tuyến giáp, bệnh thiếu máu ác tính.</br>', 'khoa da liễu', '', 'trạm xá'),
	(51, 'Co giật thiếu máu cục bộ', 'là triệu chứng ngất xỉu, đau nữa đầu, co giật từng phần, tê liệt, giảm cảm giác, chóng mặt, không có khả năng giữ thăng bằng (cứ đứng lên bước đi là ngã về 1 phía), nguyên nhân là do giảm dòng máu lưu thông.</br> Nguyên nhân gây ra chứng co giật thiếu máu cục bộ chủ yếu là thuyên tắc động mạch phổi, sơ động mạch, cao huyết áp, tiểu đường.</br> Ngoài ra, cũng do nguyên nhân như máu đông, rung nhĩ.<', ' Phẫu thuật thần kinh', 'nội khoa', 'trạm xá'),
	(52, 'Tiểu ra máu', 'là tình trạng có máu trong nước tiểu, màu nước tiểu đen, đỏ đậm được xem là hiện tượng tiểu ra máu.</br> Nếu thấy nước tiểu có màu đen hay đỏ đậm, phải đến bệnh viện khám ngay, có thể là do thận, bàng quang, tuyến tiền liệt, đường tiết niệu v.</br>v.</br> bị xuất huyết, cũng có thể là do bị sỏi như sỏi thận chẳng hạn, hơn nữa, viêm thận, bàng quang, tuyến tiền liệt cũng là nguyên nhân chủ yếu của', 'nội khoa', 'khoa tiết niệu', 'trạm xá'),
	(53, 'Khó ngủ', 'những triệu chứng sau đây được gọi là khó ngủ như: mất ngủ, không hô hấp khi ngủ, ngủ ngáy, chứng luôn thiếu ngủ, hội chứng bất an hạ chi.</br>', 'khoa tâm thần', '', 'trạm xá'),
	(54, 'Loạn nhịp tim', 'Tim tự nó phát sinh điện khí theo nguyên tắc và nó có hệ thống truyền tải tín hiệu điện khí đến toàn bộ quả tim, hệ thống này bị biến đổi hay chức năng ngừng hoạt động, làm nhịp tim đập bất nguyên tắc, hiện tượng này được gọi là loạn nhịp tim.</br> Loạn nhịp tim có nghĩa là tim có vấn đề nên phải nhanh chóng trị liệu.</br>', 'nội khoa', 'ngoại khoa', 'trạm xá'),
	(55, 'Bạch sản niêm', 'sắc tố melanin của da bị chết hay da không sản sinh được sắc tố melanin nên màu da biến thành màu trắng, vẫn chưa phát hiện nguyên nhân chính xác của bệnh này là gì nhưng được cho rằng nguyên nhân chủ yếu là do chứng tự miễn dịch, bị chết sắc tố melanin vì phơi ngoài tia tử ngoài quá lâu, căng thẳng thần kinh v.</br>v.</br>', 'khoa da liễu', 'khoa y học gia đình', 'trạm xá'),
	(56, 'Chứng đục dịch kính mắt', 'là chứng bạn thấy như có hình dạng sâu bọ nhỏ, như vật trôi nổi trong mắt, đoạn chỉ hay điểm chấm trong tầm mắt, đôi khi nhắm mắt cũng có thể thấy được, do chất vẩn đục có xung quanh võng mạc tạo nên cái bóng.</br> Đa số chứng đục dịch kính mắt một lần phát sinh sẽ kéo dài mãi.</br>', 'khoa mắt', '', 'trạm xá'),
	(57, 'Hội chứng mệt mỏi kinh niên', 'là chứng mệt mỏi nhiều hình thái đa dạng như cảm giác mệt mỏi mỗi khi thức dậy vào buổi sáng, cứ muốn nằm, cơ thể không có sức lực, uể oải không sinh lực, không đam mê.</br> Có thể là do bị trầm cảm, thân thể có vấn đề cũng là nguyên nhân chủ yếu, phương pháp chữa trị tiêm ngừa như tiêm globin miễn dịch và tập thể dục, cải thiện vệ sinh giấc ngủ v.</br>v.</br> hiện tại đối với hội chứng mệt mỏi ki', 'khoa y học gia đình', '', 'trạm xá'),
	(58, 'Chứng nhiều mồ hôi', 'là hiện tượng phản ứng với nhiệt và kích ứng cảm giác quá mức cần thiết để điều chỉnh nhiệt độ cơ thể dẫn đến chảy mồ hôi không bình thường.</br> Tùy theo bộ phận đổ mồ hôi mà phân biệt chứng đổ mồ hôi cục bộ và chứng đổ mồ hôi toàn thân.</br> Nếu sau khi trưởng thành mới phát bệnh, có thể nghi là do bị truyền nhiễm hay ung thu, bị trúng độc, bị nội tiết v.</br>v.</br>', 'ngoại khoa', '', 'trạm xá'),
	(59, 'Khi bị động vật, côn trùng cắn', 'khi bị các động vật, côn trùng như chó điên, rắn, ong cắn, trường hợp có dấu hiệu dị ứng với chất độc dẫn đến kết quả nghiêm trọng, cần khám trị kịp thời.</br>', 'khoa y học gia đình', '', 'trạm xá'),
	(60, 'Loạn thị', 'chứng vật thể nhìn thấy mờ, không rõ.</br>', 'khoa mắt', '', 'trạm xá'),
	(61, 'Viêm khớp xương', 'là chứng đau cục bộ của bộ phận khớp, không có triệu chứng bị đau toàn thân, thoái hóa chính là nguyên nhân chủ yếu gây bệnh này.</br>', 'khoa chỉnh hình', '', 'trạm xá'),
	(62, 'Viêm khoang miệng', 'đặc trưng của bệnh viêm này là phát sinh trong khoang miệng, được phân biệt theo 3 loại: viêm loét miệng, viêm mụn rộp khoang miệng, viêm ăn mòn khoang miệng.</br>', 'khoa chỉnh hình', '', 'trạm xá');
